package main

import (
	"bytes"
	"context"
	"encoding/base64"
	"fmt"
	"io"
	"os"
	"strings"
	"time"

	"github.com/aws/aws-sdk-go/aws"
	"github.com/aws/aws-sdk-go/aws/credentials"

	"github.com/werf/vault-plugin-secrets-trdl/pkg/keyhelper"
	"github.com/werf/vault-plugin-secrets-trdl/pkg/publisher"
)

type Snapshot struct {
	Files map[string][]byte
}

func doMain() error {
	ctx := context.Background()

	privKeys := publisher.TufRepoPrivKeys{}

	{
		path := os.Getenv("TRDL_ROOT_KEY_PATH")
		file, err := os.Open(path)
		if err != nil {
			return fmt.Errorf("unable to open %q: %s", path, err)
		}
		if keys, err := keyhelper.LoadKeys(file, []byte(os.Getenv("TRDL_ROOT_KEY_PASSPHRASE"))); err != nil {
			return fmt.Errorf("error loading %q: %s", path, err)
		} else {
			for _, key := range keys {
				privKeys.Root = append(privKeys.Root, key.Signer())
			}
		}
	}

	{
		path := os.Getenv("TRDL_SNAPSHOT_KEY_PATH")
		file, err := os.Open(path)
		if err != nil {
			return fmt.Errorf("unable to open %q: %s", path, err)
		}
		if keys, err := keyhelper.LoadKeys(file, []byte(os.Getenv("TRDL_SNAPSHOT_KEY_PASSPHRASE"))); err != nil {
			return fmt.Errorf("error loading %q: %s", path, err)
		} else {
			for _, key := range keys {
				privKeys.Snapshot = append(privKeys.Snapshot, key.Signer())
			}
		}
	}

	{
		path := os.Getenv("TRDL_TARGETS_KEY_PATH")
		file, err := os.Open(path)
		if err != nil {
			return fmt.Errorf("unable to open %q: %s", path, err)
		}
		if keys, err := keyhelper.LoadKeys(file, []byte(os.Getenv("TRDL_TARGETS_KEY_PASSPHRASE"))); err != nil {
			return fmt.Errorf("error loading %q: %s", path, err)
		} else {
			for _, key := range keys {
				privKeys.Targets = append(privKeys.Targets, key.Signer())
			}
		}
	}

	{
		path := os.Getenv("TRDL_TIMESTAMP_KEY_PATH")
		file, err := os.Open(path)
		if err != nil {
			return fmt.Errorf("unable to open %q: %s", path, err)
		}
		if keys, err := keyhelper.LoadKeys(file, []byte(os.Getenv("TRDL_TIMESTAMP_KEY_PASSPHRASE"))); err != nil {
			return fmt.Errorf("error loading %q: %s", path, err)
		} else {
			for _, key := range keys {
				privKeys.Timestamp = append(privKeys.Timestamp, key.Signer())
			}
		}
	}

	log.L().Debug("privKeys: %#v\n", privKeys)

	awsConfig := &aws.Config{
		Endpoint:    aws.String("https://storage.yandexcloud.net"),
		Region:      aws.String("ru-central1"),
		Credentials: credentials.NewStaticCredentials(os.Getenv("TRDL_AWS_ACCESS_KEY_ID"), os.Getenv("TRDL_AWS_SECRET_ACCESS_KEY"), ""),
	}

	repository, err := publisher.NewRepositoryWithOptions(
		publisher.S3Options{AwsConfig: awsConfig, BucketName: "trdl-test-project"},
		publisher.TufRepoOptions{PrivKeys: privKeys},
	)
	if err != nil {
		return fmt.Errorf("error initializing publish repository instance: %s", err)
	}

	var files []*publisher.InMemoryFile

	files = append(files, &publisher.InMemoryFile{
		Name: "a/b/c/data.txt",
		Data: []byte("HELLO WORLD\n\nHELLO WORLD\n"),
	})

	files = append(files, &publisher.InMemoryFile{
		Name: "a/b/c/info.txt",
		Data: []byte("not much\n"),
	})

	if err := publisher.PublishInMemoryFiles(ctx, repository, files); err != nil {
		return fmt.Errorf("unable to stage files %#v: %s", files, err)
	}

	releaseFile := "bin/arbuz"
	if err := publisher.PublishReleaseTarget(ctx, repository, "v1.1.10+fix2", releaseFile, base64.NewDecoder(base64.StdEncoding, bytes.NewReader([]byte(binArbuzBase64)))); err != nil {
		return fmt.Errorf("unable to publish release target %q: %s", releaseFile, err)
	}

	r, w := io.Pipe()
	go func() {
		for i := 0; i < 30; i++ {
			time.Sleep(1 * time.Second)

			line := fmt.Sprintf("Hello %d\n", i)
			log.L().Debug("send line %q\n", line)

			if _, err := io.Copy(w, strings.NewReader(line)); err != nil {
				if err := w.CloseWithError(err); err != nil {
					panic(err.Error())
				}
			}
		}

		if err := w.Close(); err != nil {
			panic(err.Error())
		}
	}()

	releaseFile2 := "lib/info.txt"
	if err := publisher.PublishReleaseTarget(ctx, repository, "v1.1.10+fix2", releaseFile2, r); err != nil {
		return fmt.Errorf("unable to stage release file %q: %s", releaseFile2, err)
	}

	if err := repository.Commit(ctx); err != nil {
		return fmt.Errorf("unable to commit new repository state: %s", err)
	}

	return nil
}

func main() {
	if err := doMain(); err != nil {
		fmt.Fprintf(os.Stderr, "ERROR: %s\n", err)
		os.Exit(1)
	}
}

var binArbuzBase64 = ``
